import React from "react";
import StoreBlogCard from "../common/StoreBlogCard";
import StoreSections from "../common/StoreSections";
import "./store_blog.css";

const blogposts = [
  {
    img: post5,
    title: "Recognizing the need is the primary design condition",
    content:
      "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the standard...",
    authorAndDate: "22 de Fevereiro de 2020 | por Annabela Souza",
    id: 1,
  },
  {
    img: post2,
    title: "Just found the ultimate denim dresses for summer",
    content:
      "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the standard...",
    authorAndDate: "03 de Maio de 2020 | por Amanda Rodrigues",
    id: 2,
  },
  {
    img: post3,
    title: "Fashion tells about who you are from external point",
    content:
      "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the standard...",
    authorAndDate: "12 de Agosto de 2020 | por Pietra Campos",
    id: 3,
  },
  {
    img: post4,
    title: "We want to be different, and fashion gives me outlet",
    content:
      "Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the standard...",
    authorAndDate: "18 de Setembro de 2021 | por Carina Flores",
    id: 4,
  },
];

const index = () => {
  return (
    <div className="store__blog">
      <StoreSections
        title="Histórias de amor à moda"
        subtitle="Nosso blog de estilo de vida"
      />
      <div className="store__blog-container store__container">
        {blogposts.map((post, i) => (
          <StoreBlogCard post={post} key={post.id} />
        ))}
      </div>
    </div>
  );
};

export default index;
